import React from 'react';
import Card from './Card';

const CardList = ({ robots }) => {
    const cardComponent = robots.map((user, i) => {
        return (
            <Card 
            key={i} 
            id={robots[i].id} 
            name ={robots[i].name} 
            email={robots[i].email}
            />
        );
    }) //key={i}} let's the DOM know which card is which (ie. in case you delete one of the card, it won't get confused)
    return (
        <div>
            { cardComponent }
        </div>
    );
}

export default CardList;
